import java.util.concurrent.CopyOnWriteArraySet;

public class Main {
    public static void main(String[] args) {
        CopyOnWriteArraySet<Integer> set = new CopyOnWriteArraySet<>();

        // Initialize some values
        int interimCalc = 42; // Unrelated calculation
        boolean toggle = false;

        /* Write point */
        if (interimCalc % 2 == 0) {
            set.add(100); // This is the key write operation
            toggle = true;
        }

        // Additional misleading operations
        set.add(200);
        set.add(300);
        set.remove(200); // Remove operation unrelated to the read point

        // More operations
        if (toggle) {
            set.add(400); 
        } else {
            set.add(500);
        }

        // Ensure order in our set for deterministic read
        Integer[] orderedSet = set.toArray(new Integer[0]);

        /* Read */
        int ret = orderedSet[0];

        // Output the read value
        System.out.println("Read value: " + ret);
    }
}
